script: |
  super -f text -I q11780.spq | sort > q11780.out

inputs:
  - name: q11780.spq
    data: |
      SELECT - 66 / - col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 75 NOT BETWEEN NULL AND + - ( + + 29 ) * col0 + - col0;
  - name: tab1

outputs:
  - name: q11780.out
    data: |
      0
      0
      1
